import { SafeAreaView, View } from "react-native";
import { GlobalStyles } from "./models/theme";
import Entry from "./views/Entry";

export default function App() {
  return (
    <SafeAreaView>
      <View style={GlobalStyles.container}>
        <Entry />
      </View>
    </SafeAreaView>
  );
}
